description:
Entrapments (Forbidden Fruits Films / **NEW** / 2014)

Deception takes on many forms, and just when you think you are in control... you find out you are not! Four tales of seduction and twisted blackmail by women who know what they want, and know how to trap their prey to get it!

Carter Cruise, Payton Simmons, Chloe Amour, Daisy Haze, Bruna, Tony D., Tony DeSergio

Vignettes

